import React from "react";
import About from './About'
import Contact from './Contact'

//* React Router ka main kaam hota hai ki jab bhi hum url pe kuch bhi type krte hai agr vo hamare existing comp se match 
//* krta hai to isko ye render karata hai  

const App = () => {
    return (
        <>
          <Switch>
                <Route path="/" Component={About} />
                <Route path="/conatct" Component={Contact} ></Route>

            </Switch>
        </>
    )
}

export default App;
